:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  WILLIAMS, Samuel and WILLIAMS, Mary
  JWILLIAMS, William Temple and PUCKEY, Annie Matilda Sophia Marilla
  JWILLIAMS, Charles Athol and BURR, Mary Russell (Meg)
  JWILLIAMS, Patricia Mary and OJALA, Eric Mervyn
  VOJALA, Helen Jean and LUCY, Michael Francis
  04> LUCY, Samuel Timothy
  b 02.12.1995
  Samuel b. at Hastings.
  02> OJALA, Robin Athol and DAVIES, Melonie Jane
  b 24.11.1964
  b 18.08.1968
  Robin b, at Auckland. Melonie b. at Cheviot, Canterbury. Robin and Melonie plan to marry on
  05.12.1998. Address: 34 Erskine Street, North Melbourne 3051, Vic, Australia.
  Rob was educated at Junior English School, Rome, Italy; Michael Hall, Forest Row, Sussex, England;
  Rudolf Steiner School, Hastings, and Havelock North High School. He graduated from Otago
  University with a BSc in 1986 and MBCHB in 1990. He has specialised in emergency medicine at
  hospitals in Christchurch and Melbourne.
  Melonie is a neo-natal intensive care nurse and a qualified midwife. She is presently practising
  at the Mercy Hospital for Women in Melbourne.
  02> WILLIAMS, Eric Temple m on 02.04.1949 to SCOTT, Heather Frances
  b 04.05.1924
  b 31.10.1924
  Eric b. at Pukehou. Heather, d/o Walter Scott (farmer) and Mary Edith Clarke (author of NZ books).
  Address: RD 4, Cambridge.
  Eric was educated at Hereworth School and Wanganui Collegiate School (head of Selwyn House). He is a
  retired drystock farmer and was a foundation member of the Coopworth Sheep Society. He served as a
  Flying Officer in the Airforce in Canada and the UK during WW2. Eric is an active farm forester. He
  has grown and harvested pine woodlots on the farm and, since the early 1980s, with partner John
  Mortimer, is operating a business involving exotic timbers (such as Australian blackwood, oak, elm etc)
  grown in New Zealand. These are milled on other farms and later dried lumber is sold to furniture and
  joinery manufacturers.
  Heather is a physiotherapist and a highly accomplished gardener, hosting many like-minded visitors.
  01> WILLIAMS, Anna Jane m on 22.04.1978 to MANDENO, Thomas Graham
  b 20.07.1950
  b 14.02.1946
  Anna b. at Te Awamutu and m. at Cambridge, NZ. Thomas, s/o Graham Lloyd Mandeno (DSO, DFC and Bar)
  and Vera Mason Cooper, b. at Cambridge, England. Address: Far Fields Farm, Waikaretu, Tuakau.
  Anna is a registered nurse with interests in the Outward Bound Association, landscaping,
  photography and animals. She is a trustee of the H and W Williams Trust.
  Thomas is a sheep and beef farmer at Waikaretu. He is a Nuffield Farming Scholar and a Winston
  Churchill Fellow. He has served on the Raglan County Council and as a director of the NZ Wool
  Board and is a Justice of the Peace.
  Refer to "A Huguenot Family. The Descendants of John and Mary Mandeno" published by Evagean
  Publishing in 1997 for details of Thomas' family.
